import React from 'react';
import { Link } from 'react-router-dom';

const Menu = () => {
    return (
        <div className="menu">
            <Link to="/my-recipes">My Recipes</Link>
            <Link to="/add-recipe">Add Recipe</Link>
            <Link to="/schedule">Schedule</Link>
            <Link to="/plan">Plan</Link>
        </div>
    );
}

export default Menu;
